import { render } from 'react-dom'


class UpdateBalance extends Component {
    constructor(props) {
        super(props)
        this.state = this.initialState
    }

render = () => {
    return (
        <div>
            <h1>User Balance</h1>
            <div></div>
         
          
        </div>
    )
   }
}

export default UpdateBalance
